import React from 'react';
import './Experience.css';

function Experience() {
  const experience = [
    { Company: 'Hyper tech global technologies Pvt ltd', Position: 'Front End Developer', Location: 'Remote', Duration: ' March 2024 - july-2024' },
    { Company: ' Hexolt Life Solutions pvt. ltd', Position: 'Bhagwati Girls High School And Junior Collage', Location: '2020', Percentage: '53.60' },
    { Company: '10th Grade', Position: 'Adarsh Sanskar Vidyalaya', Location: '2018', Percentage: '74.60' },
  ];
  return (
    <section id='expeience' className='experience'>
      <div className='container expeience-me'>
        <div className='heading-wrapper'>
          <h2>Experience</h2>
        </div>

        <div className='row'>
          <div className='row education-content'>
            {experience.map((edu, index) => (
              <div key={index} className='col-lg-12 education-item'>
                <h4>{edu.degree}</h4>
                <p><strong>Institution : </strong> {edu.institution}</p>
                <p><strong>Year : </strong> {edu.year}</p>
                {edu.SGPA && <p><strong>SGPA : </strong> {edu.SGPA}</p>}
                {edu.Percentage && <p><strong>Percentage:</strong> {edu.Percentage}</p>}
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  )
}

export default Experience
